		<bio><para>Father: Ivan Igorevich Burov</para><para>Mother: Anya Aleksovna Petrov</para><para>Siblings: Romon, Andrei, Zia</para><para></para><para>Ilya Ivanovich Burov was born in Heldren in 4678 AR to Ivan and Anya, two Tiefling farmers. He had the type of childhood one would expect growing up on a farm - he spent his days tending animals or helping his father in the fields, and the evenings playing in the woods with his two brothers and sister or other village children or reading what books and scrolls he could get his hands on, usually borrowed from the cleric at the temple of Erastil. As a young boy he never had great dreams of exploring the world and expected he would live in Heldren all his life, just as his father had. But at midnight on his tenth birthday he suddenly fell unconscious. For three days he lay unconscious, unable to be roused by any means - ordinary or magical. When he finally awoke on the fourth day, he had lost all strength in his body. It required tremendous effort simply to sit up in bed, and any thought of standing or walking was unimaginable.</para><para></para><para>As no one knew the source of his affliction, none could say what his future prognosis might be. Aside from the unnatural weakness he was hale and sound in every other way. Days turned into weeks, weeks become months, months stretched into years.  Ilya&#39;s parents steadfastly cared for him day in and day out, with more and more help from his brothers and sister as they aged. Ilya grew sullen and resentful - hating his meager existence, confined to a bed and unable to live life as others did. Ilya&#39;s siblings all grew, married and started families of their own. When his siblings had extra money, they would often purchase books or scrolls for him to read, as he had little else to fill his time, and the occupation with the text filled his mind.</para><para></para><para>One night, after several years in this state, his father came and told him a story. A story of his great-grandfather who had lived in Irrisen. Ilya had heard stories of his great-grandfather Grigory before, but never this one. His father told him how Grigory had decided to leave the lands of Irrisen, to escape the evil witches there and make a new life for himself in the south. Grigory set out with only the clothes on his back in the dead of night. Planning to cross the &quot;uncrossable&quot; Kodar Mountains into Varisia, he headed south from his city of Hoarwood when he was seen by the Duchess Anelisha Elvanna, ruler of Hoarwood. He began to run, hoping to escape her foul magic. She did not pursue him, but instead he heard her drunkenly scream in his direction, &quot;Your blood will never escape Irrisen, and your bones will ever be weak!&quot; Grigory never looked back and was able to cross the Kodar Mountains unimpeded. He put the memory of Anelisha Elvanna behind him, and assumed that it had been a meaningless taunt rather than the curse he feared it to be. Nevertheless, he passed the story down through the generations lest it ever be forgotten how dangerous it would be for anyone of the Burov family to return to Irrisen. Though his father had never believed in the curse before, with every other avenue of healing exhausted, he was beginning to believe it was the only remaining explanation.</para><para></para><para>Over the years, through intense effort, he was able to build a small amount of physical strength back. He could eventually feed and care for his own needs, but cooking, working or doing any further task remained beyond him. When he was 23, he was moved to a small hut on his parents&#39; land where he was able to live somewhat independently, although his inability to move more than a few paces at a time left him with the lifestyle of an involuntary hermit. Nonetheles, the isolation and helplessness weighed heavily on his mind. One night, deep in the depths of despair, he summoned all his strength to tie a noose and throw it over a rafter in his hut. As he prepared to step onto a chair under the rope there came a knock at the door. Outside were two men, hooded and cloaked. In the darkness, he could not make out their features, but one of them spoke confidently as soon as Ilya opened the door.</para><para></para><para>&quot;Magic can do more than heal.&quot;</para><para>&quot;Magic is strength,&quot; the other intoned.</para><para></para><para>The frst man reached out a finger and touched Ilya&#39;s forehead.</para><para></para><para>&quot;Magic is strength,&quot; he repeated.</para><para>&quot;Nethys has shown the way,&quot; the second said, producing a tome from within his cloak and handing it to Ilya.</para><para></para><para>&quot;Be strong,&quot; both said together. With that, both men turned and walked off into the night.</para><para></para><para>Ilya studied the book in his hands. It was the Book of Magic, the holy text of Nethys. He stayed up the rest of the night reading and studying it. The next morning, Andrei stopped by for a visit, bringing along a mule he&#39;d found alone on the road. </para><para></para><para></para></bio>
